measurements.description:
One flower and one bud on one upright inflorescence; 

	dorsal sepal slightly hooked, cream overlaid dark pink;
	synsepal light yellow, overlaid dark pink, darker on edges;
	petals slightly sweeping forward, cream overlaid dark pink, darker distally;


	 pouch exterior maroon, interior light yellow spotted maroon;	
	staminode light yellow, overlaid pink;



	substance firm; texture crystalline.
